<p> </p> 
<p><b>Covid-19 : La Banque Postale fait évoluer son dispositif. <a href="#" onclick="javascript:return tc_events_global(this, &quot;CLICK&quot;,{&quot;titre_section&quot;:&quot;Comptes&quot;,&quot;libelle_lien&quot;:&quot;En savoir plus&quot;,&quot;url_cible&quot;:&quot;/content/particulier/actualites/covid19.html&quot;,&quot;id_composant&quot;:&quot;/apps/labanquepostale/particuliers/components/navigationComp&quot;});">En savoir plus</a><br> </b></p> 
<p> </p> 
<p><span style="font-weight: bold;">La Banque Postale mobilisée pour tous ses clients</span><br>
Pendant la crise sanitaire du Coronavirus COVID-19, La Banque Postale assure la continuité de services et l’accompagnement de tous ses clients.
<br><br>
<span style="font-weight: bold;">Autres actualités</span><br>
La Poste présente son plan de déconfinement
Dans la perspective de la prochaine phase de déconfinement, La Poste projette de rétablir une distribution des courriers et des colis 6 jours sur 7 de manière progressive à partir du 11 mai, et lance de nouveaux services pour accompagner ceux qui doivent continuer à rester chez eux. Tous les bureaux de poste de France seront ouverts à la fin du mois de mai avec des horaires adaptés. Ce plan de déconfinement, qui organise notamment le retour sur site des postiers dont les activités ne sont pas compatibles avec le télétravail, sera présenté aux organisations syndicales cette semaine. ».</p> 
<p> </p> 

